import './Summary.css'
// import Header from './Header'
import Body from './Body';
import Details from './Details';
import {MdAddCard} from 'react-icons/md';

function Summary() {
    return (
        <div className="summary">
            <MdAddCard/>
            <Body/>
            <Details/>
        </div>
    )
}

export default Summary;
